INSERT INTO public.charity VALUES (1, 'Arise', 'Arise supports women and children who have experienced domestic violence, enabling them to rebuild their lives.The impact of domestic violence is far reaching, impacts the whole community and can continue for generations.
INSERT INTO public.charity VALUES (2, 'Aves do Brasil', 'You can help save birds that are considered critically endangered and at risk of extinction in the wild.
INSERT INTO public.charity VALUES (3, 'Clara Santos Oliveira Institute', 'The Clara Santos Oliveira Institute is a non-governmental, non-profit organisation based in Sao Paulo. Clara founded the institute in 1986 to provide shelter and education to young people who have been through the juvenile court.Today there are five houses in Sao Paulo and we want to expand and set up another three by 2020.', 'clara-santos-oliveira-institute-logo.png');
INSERT INTO public.charity VALUES (4, 'Conquer Cancer - Brazil', 'Conquer Cancer Brazil (CCB) is dedicated to helping discover the treatments and cures for cancer by funding world class research within Brazil.We raise funds exclusively for research into the prevention, diagnosis and treatments for ALL types of cancer, in centres right across Brazil.
INSERT INTO public.charity VALUES (5, 'Diabetes Brazil', 'Diabetes Brazil is committed to reducing the impact of diabetes through education, early detection and support.
INSERT INTO public.charity VALUES (6, 'Heart Health São Paulo', 'For over 50 years, Heart Health São Paulo has been dedicated to saving lives by making a difference to the heart health of our people.Donations help us fund valuable research, develop guidelines for health professionals, support patient care and help Paulistas to live healthier lifestyles.', 'heart-health-sao-paulo-logo.png');
INSERT INTO public.charity VALUES (7, 'Human Rights Centre  - São Paulo', 'The Human Rights Centre protects and promotes human rights in Brazil and in Brazilian activities overseas. This is done through legal action, advocacy and research.The HRC is an independent, not-for-profit, non-government organisation and is a registered charity.
INSERT INTO public.charity VALUES (8, 'Stay Pumped', 'Stay Pumped is a charity that helps retired professional sports people who often struggle to adjust to life after sport. Many are underprepared, lacking education and life skills required to make the enormous adjustment. They often have the added burden of injury.
INSERT INTO public.charity VALUES (9, 'Upbeat SP', 'Upbeat SP is a not-for-profit organisation that offers support for those suffering from mood disorders such as depression and bipolar disorder.In addition we conduct research studies to help with the understanding of mood disorders. Our latest project is working to use technology to solve mental health issues.We are looking at social media as an indicator of mental health, and also at using mobile phones to measure mental health.
INSERT INTO public.charity VALUES (10, 'WWSM Rescue', 'The small WWSM Rescue organisation works tirelessly devoting itself to the preservation of the White Whiskered Spider Monkey.Deforestation and conversion of land for agriculture has severely impacted on this monkeys home. Unfortunately they are also hunted and have been pushed to the brink of extinction.
INSERT INTO public.charity VALUES (11, 'The Red Cross', 'Relief in times of crisis, care when its needed most and commitment when others turn away.Red Cross is there for people in need, no matter who you are, no matter where you live.
INSERT INTO public.charity VALUES (12, 'Oxfam International', 'Oxfam is an international confederation of 17 organizations working together with partners and local communities in more than 90 countries.
INSERT INTO public.charity VALUES (13, 'Save the Children Fund', 'Save the Children is the worlds leading independent organisation for children.We work in around 120 countries.We save childrens lives; we fight for their rights; we help them fulfil their potential.
INSERT INTO public.charity VALUES (14, 'Querstadtein Berlin', 'querstadtein is the first project of Stadtsichten e.V., a registered non-profit association.
